INSERT INTO `encuesta` (`id`, `nombre`, `descripcion`, `instrucciones`, `mensaje`, `fecha`) VALUES
(1, 'ENCUESTA PARA ESTUDIANTES', 'Recolectar información sobre la percepción que la comunidad universitaria tiene de los procesos académicos y administrativos desarrollados por la Institución para el logro de sus  objetivos misionales, con el fin de adelantar el proceso de autoevaluación institucional.', 'A continuación encontrará una serie de preguntas y afirmaciones. Con relacion a las preguntas responda afirmativamente o negativamente de acuerdo a su criterio y en los casos donde se presentan afirmaciones, valorelos según su grado de acuerdo con la siguiente escala de calificación:\r\n5 - Completamente de acuerdo\r\n4 - De acuerdo\r\n3 - Parcialmente de acuerdo\r\n2 - En desacuerdo\r\n1 - Completamente en desacuerdo\r\n0 - No sabe', 'mensaje', '2012-04-28 16:06:06'),
